{%- set duration = current - start_time -%}
{{-
    {
        "gh_user": CTX.step_1.gh_user,
        "ctf_user": CTX.body.username,
        "start_time": start_time,
        "end_time": current,
        "duration": duration
    } | json_dump
-}}

